import React from 'react';

class Blog extends React.Component{
	render(){
		return(
	  	 React.createElement(
	  	 	"h2", 
	  	 	{ classname: "title"},
	  	 	"Welcome to Blog!"
	  	 	)
	  	)
	}
}
export default Blog;
